int My_HUD_Redraw(float time, int intermission)
{
	UpdateScreenInfo();
	if (g_Vars.LocalCheck)
	{
		for (int i = 0; i < 33; i++)
		{
			if (g_Vars.ESPBox)
				DrawPlayerBox(i);
			if (g_Vars.ESPDist)
				DrawDistance(i);
			if (g_Vars.ESPName)
				DrawPlayerName(i);
			if (g_Vars.ESPWeapons)
				DrawPlayerWeapon(i);
			if (g_Vars.ESPTrace)
				DrawPlayerTrace(i);
			if (g_Vars.ShowTargetID)
				DrawTargetID(i);
		}
		if (g_Vars.DrawCrosshair)
			DrawCrosshair(g_Vars.CrosshairColor[0] * 255, g_Vars.CrosshairColor[1] * 255, g_Vars.CrosshairColor[2] * 255, g_Vars.CrosshairColor[3] * 255);
	}
	g_Engine.OverrideLightmap(g_Vars.OverrideLightmap);
	if (g_Vars.OverrideLightmap)g_Engine.SetLightmapColor(1.0f, 1.0f, 1.0f), g_Engine.SetLightmapDarkness(g_Vars.SetLightmapDarkness);
	return g_Client.HUD_Redraw(time, intermission);
}

void My_CL_CreateMove(float frametime, struct usercmd_s* cmd, int active)
{
	AdjustSpeed(1.f);
	g_Local.flFrametime = frametime;
	g_Client.CL_CreateMove(frametime, cmd, active);
	if (g_Vars.LocalCheck)
	{
		if (g_Vars.FastRun)
			FastRun278(cmd);
		if (g_Vars.GroundStrafe)
			GroundStrafe(cmd);
		if (g_Vars.StrafeHelper)
			AutoDir(cmd), StrafeHack(frametime, cmd, false);
		if (g_Vars.BunnyHop)
			BunnyHop(cmd);
		if (g_Vars.RageAimbot)
			AimBot(cmd);
		if (g_Vars.AntiAim)
			AntiAim(cmd);
	}
}

